import React from "react";

function GoalsList() {
  return (
    <div className="goals__list">
      <ul className="list">
        <li className="list__item">
          FIRST
          <div>
            <button>CHECK</button>
            <button>DELETE</button>
          </div>
        </li>
        <li className="list__item">SECOND</li>
        <li className="list__item">THIRD</li>
      </ul>
    </div>
  );
}

export default GoalsList;
